import React from 'react';
import {RiHome7Line} from 'react-icons/ri';
import {ImInfo} from "react-icon/im";

export const Navitems = [
    {
        title: 'Home',
        path: '/home',
        icon: <RiHome7Line/>,
    },
    {
        title: 'Profile',
        path: '/profile',
        icon: <ImProfile/>,
    },
    {
        title: 'About',
        path: '/about',
        icon: <ImInfo/>,
    },
]
